import React from 'react'
import ReactDOM from 'react-dom';
import StoreFrames from './StoreFrames.js'
import './Store.css'
import StoreCategories from './StoreCategories';

export const items = (items) =>
{
    const element = (
        <items/>
    );
    ReactDOM.render(element, document.getElementsByClassName('.store__right'));
}

function Store() {
    return (
        <div className='store'>
            <div className='store__left'>
                <StoreCategories/>
            </div>
            <div className='store__right'>
                <StoreFrames />
            </div>
        </div>
    )
}

export default Store;
